import React from 'react'
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';


const Home = () => {

const Toast = () => {
 
  toast("Wow so easy!")
}

  return (
    <div className='home'>
       <h1>
        Home Page 
      </h1>

      <button 
      onClick={Toast}
      className='btn_css'>
        Log In
      </button>
      
        <ToastContainer />
    </div>
  )
}

export default Home
